import React , {useState} from "react";
import "./App.css";
import Aux from "./Auxiliary/Auxiliary";



function App() {
  const [count, func] = useState(0);
  const increment = () => {
    func(count + 1);
  }

  return (
    <Aux>
    <div className = "counter">
    <h1> {count} </h1>
    <h1>GET </h1>
    <button onClick = {increment}>CLICK ME</button>
    </div>

    </Aux>
  );
}

export default App;
